import React from "react"
import { yyyymmddhhmmss2 } from "@utils/dataTime"
import "./style.scss"

type WealProps = {
 data: any;
 activityTypes: any[]
 [random: string]: any
}
const Weal = (props: WealProps) => {
 const { data = {}, activityTypes } = props;
 const getActivityName = (id: number) => {
  const item = activityTypes.find(item => item.id === id)
  if (item) {
   return item.name;
  }
  return "";
 }
 return (
  <div className="weal">
   <div className="left">
    <p className="title">{getActivityName(data.activityId).slice(0, 1)}</p>
    <p className="detail">
     <span className="zh">{getActivityName(data.activityId)}</span>
     <span className="date">{yyyymmddhhmmss2(data.createTime)}</span>
    </p>
   </div>
   {
    data.status === 1 && (
     <div className="right">
      {/* <p className="num">+48</p> */}
      <p className="status resolve">通过</p>
     </div>
    )
   }
   {
    data.status === 2 && (
     <div className="right ">
      {/* <p className="num">+48</p> */}
      <p className="status reject">拒绝</p>
     </div>
    )
   }
   {
    data.status === 3 && (
     <div className="right ">
      {/* <p className="num">+48</p> */}
      <p className="status">审核中</p>
     </div>
    )
   }
  </div>
 )
}

export default Weal;
